import React from 'react'
import { withRouter } from 'react-router'



const Welcome = () => {

    const handleClick = (e) => {
        console.log("hi")
        return <Redirect push to="/login" />
    }

    return(
        <>
            <button onClick={handleClick}>Login</button>
        </>
    )
}

export default (withRouter(Welcome))
